import React from 'react'
import styled from 'styled-components';



const IntroContainer = styled.div`
    display: flex;
    justify-content: center;
    background: blue;
    position: fixed;
    width: 800px;
    height: 500px;
    align-items: center;
    z-index: 10;
    margin: 150px 0 0 500px;
`
const IntroHeader = styled.div`
    display: flex;
    place-items: center;

    width: 50%;

`

const HomeHeader = () => {
    return (
        <IntroContainer >
            <IntroHeader>History Revealed Presents</IntroHeader>

        </IntroContainer>
    )
}

export default HomeHeader
